import React from 'react';
import { View, Image, Text, StyleSheet } from 'react-native';

function HomePage(props) {
    return (
        <View>
            <Image style={StyleSheet.logo} source={require('../assets/logo.png')} />
            <Text>Learning</Text>
        </View>
    );
}

export default HomePage;
